const { createTheme } = require("@mui/system");

export const Colors = {
    primary: "white",
    secondary: "white",
    body_bg: "#9093C4",

};

export const overrides = {
    palette: {
        primary: {
            main: Colors.primary
        },
        secondary: {
            main: Colors.secondary
        },
    },
    components: {
        MuiButton: {
            background: "#fff"            
        }
    }
};

export const theme = createTheme({
    ...overrides
})
